// 初始化資料到 localStorage（如果尚未存在）
function initHardcodedData() {
  const STORAGE_KEY = 'companiesStore';
  const existingData = localStorage.getItem(STORAGE_KEY);
  
  // 如果已有資料且不為空，不覆蓋
  if (existingData) {
    try {
      const parsed = JSON.parse(existingData);
      if (Array.isArray(parsed) && parsed.length > 0) {
        console.log('已存在 ' + parsed.length + ' 筆公司資料，使用現有資料');
        return;
      }
    } catch (e) {
      console.warn('現有資料解析失敗，將使用寫死資料');
    }
  }
  
  // 寫入寫死的資料
  localStorage.setItem(STORAGE_KEY, JSON.stringify(HARDCODED_COMPANIES_DATA));
  console.log('已初始化 ' + HARDCODED_COMPANIES_DATA.length + ' 筆公司資料');
}

// 頁面載入時自動初始化
if (typeof window !== 'undefined') {
  window.addEventListener('DOMContentLoaded', initHardcodedData);
}

// 匯出資料供其他檔案使用
if (typeof module !== 'undefined' && module.exports) {
  module.exports = { HARDCODED_COMPANIES_DATA, initHardcodedData };
}
